import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch,
} from "react-router-dom";
import Home from "./Pages/Home";
import Login from "./Login";

function App() {
  return (
    <div className="App">
      <Router>
        <main>
          <Switch>
            <Route path="/" exact component={Login} />
            <Route path="/home" exact component={Home}/>
          </Switch>
        </main>
      </Router>
    </div>
  );
}

export default App;
